MUSIC | After releasing the acclaimed video for the track &quot;<a href="http://www.last.fm/music/P!nk/_/Try">Try</a>&quot;, Pink has just released her new music video. The single chosen was &quot;<a href="http://www.last.fm/music/P!nk/_/Just+Give+Me+a+Reason">Just Give Me a Reason</a>&quot;, part of the CD &quot;<a href="http://www.last.fm/music/P!nk/The+Truth+About+Love">The Truth About Love</a>.&quot;
 With the participation of the singer of the American band fun., Nate Ruess, which also shares some scenes with the singer, the clip is composed of images of a couple who enters into crisis, and as well as describing the lyrics, questions remain about the what happened to the love between them.

